import React from "react";
import MvEmail from "../generalLayout/mvEmail";
import { ScrollNavFunction } from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
import MotorPageHeader from "../generalLayout/motorPageHeader";
import { FooterGe } from "../generalLayout/footer_test";
import { NavWhiteCompact } from "../generalFunctionForOnScroll/ScrollEventFor_Homepage";
import Nav from "../generalLayout/nav";
import NavDesktop from "../generalLayout/navDesk";
import DesignTips from "../generalLayout/designTips";
import MotorProperties from "../generalLayout/motorProperties";
import MvEngineMotor from "../generalLayout/mvEngineMotor";
import MotorItem from "../generalLayout/motorItems";
const heroGradientStart = "#A4191B";
const heroGradientEnd = "#6B0B0D";
const rush1000infor = {
  namePage: "Rush 1000",
  price: "34.000",
  nameHeaderTitle: "rush1000/sssssss.svg",
  bgHeaderParallax: "rush1000/rush-1000-xl.png",
  manifesto_Arr: ["THE", "BEAST", "MODE"],
  colorBg: `linear-gradient(90deg,${heroGradientStart} 0%,${heroGradientEnd} 100%)`,
  contentHeaderContent:
    "The bewitching, ground-breaking hypernaked. The only production bike with radial valves and titanium connecting rods",
  Model3ds: {
    original: {
      link: "rush1000/original/rush1000",
      colorOriginal:
        "linear-gradient(45deg, rgba(45,0,12,1) 25%, rgba(121,9,9,1) 50%, rgba(255,0,0,1) 100%)",
    },
    mod: {
      link: "rush1000/racingKit/rush1000rc",
      colorMod:
        "linear-gradient(45deg, rgba(0,0,0,1) 25%, rgba(56,56,56,1) 60%, rgba(148,148,148,1) 100%)",
    },
  },
};
export default function Rush1000() {
  window.addEventListener("scroll", () => {
    ScrollNavFunction();
    NavWhiteCompact();
  });
  return (
    <>
      <div
        className="nav-pc-homepage"
        style={{
          height: "84px",
          width: "100vw",
          background: rush1000infor.colorBg,
        }}
      ></div>
      <NavDesktop />
      <Nav color="white" />
      <PageName namePage={rush1000infor.namePage} />
      <MotorPageHeader
        manifesto_Arr={rush1000infor.manifesto_Arr}
        nameHeaderTitle={rush1000infor.nameHeaderTitle}
        colorBg={rush1000infor.colorBg}
        contentHeaderContent={rush1000infor.contentHeaderContent}
        price={rush1000infor.price}
        bgHeaderParallax={rush1000infor.bgHeaderParallax}
        reveredContent={false}
        heightContentTop="20%"
        titleSize="auto 21%"
      />
      <Motor3d
        models={rush1000infor.Model3ds}
      />
      <MotorProperties />
      <DesignTips />
      <MvEngineMotor />
      <MotorItem />
      <MvEmail></MvEmail>
      <br />
      <FooterGe />
    </>
  );
}
